@import "variables/variables";


* {
    box-sizing: border-box;
    z-index:1;
}

html {
    height: 100%;
}

body {
    transition: all 200ms ease-in-out;
    height: 100%;
}

#auth-nav {
    box-shadow: 2px 2px 10px #222,
                -2px -2px 10px #222;
    height:55px;
    padding-top: 10px;
    width:100%;
    h3 {
        clear: both;
        float:$leftFloat;
        font-weight:bold;
        color:$firstColor;
        font-size:25px;
    }
    ul {
        clear: both;        
        float:$rightFloat;
        li {
            display: inline;            
            float:$leftFloat;
            margin-left:35px;
            margin-top:5px;
            a {
                
                text-decoration: none;
                color:$firstColor;
                transition: all .2s ease-in-out;
                font-weight: bold;                
                &:hover {
                    color:$thirdColor;
                }
    
            }
        }
    }
}

.login {
    height: 100%;
    div.row {
        height: 100%;

    }
    .left-side-login {
        margin-top:2px;
        height:100%;
        width:100%;
        background:$firstColor;
        .left-side-messages {
            position: relative;
            top:25%;
            left:40px;
            h3 {
                color:$secondColor;
                padding:15px;
                font-size:20px;
                i {
                    margin-right:5px;
                }
            }    
        }
    }

    .login-panel {
        display:block;
        margin: 15px auto;
        h1 {
            color:$firstColor;
            text-align: center
        }
        p {
            font-weight:bold;
            color:#000;
            text-align: center;
            text-transform: uppercase;
            padding:15px;
        }
        form {
            // width:450px;
            display:block;
            margin:0 auto;
            margin-top:50px;
            border:1px solid #CCC;
            background-color:rgba(238, 238, 238, 0.218);
            padding:35px;
            input[type=submit]{
                border:1px solid $firstColor;
                color:$firstColor;
                transition: all .3s ease-in-out;
                &:hover {
                    background-color:$firstColor;
                    color:#FFF;
                    border-color:#FFF;
                }
            }
        }
    }
}


.register {
    position: fixed;
